// import { useSelector, } from "react-redux";
import { deletRow, editRow } from "../../redux";

function Body({ tableList, dispatch }) {
  // const tableList = useSelector()
  return (
    <tbody>
      {tableList.length > 0 &&
        tableList.map((row) => (
          <tr key={row.id}>
            <td>{row.fname}</td>
            <td>{row.lname}</td>
            <td>
              <button
                type="button"
                onClick={() => {
                  dispatch(deletRow(row.id));
                }}
              >
                -
              </button>
              <button
                type="button"
                onClick={() => {
                  dispatch(editRow(row.id));
                }}
              >
                -
              </button>
            </td>
          </tr>
        ))}
    </tbody>
  );
}

export default Body;
